  render() {
    return(
      <div className="app container">
        <div className="row">
          <div className="col border">
            <Drawing />
          </div>
          <div className="col border">
            <Numbers />
          </div>
        </div>
        <div className="row">
          <div className="col">
            <Ticket />
          </div>
          <div className="col">
            <Play />
          </div>

        </div>
      </div>)
  }
}

class Numbers extends React.Component {
  render() {
    const listItems=numbers.map((number, index) => 
        <button key={index} value={number} className="number">{number}</button>
        )
    return(
      <div>
      <h2>Brojevi</h2>
        <div>
        {listItems}
        </div>
      </div>)
  }
}

